Kani allows three options to specify the unwind value for a particular harness: The unwind annotation #[kani::unwind(<num>)]. This sets the unwind value for the harness with the annotation. Example - #[kani::proof]
#[kani::unwind(3)]
fn proof_harness() {
[...]
